import * as Actions from "./Actions.js";

function Reducer(state, action) {
  switch(action.type) {
    case ADD_BULLET:
      break;
    case EDIT_BULLET:
      break;
    case REMOVE_BULLET:
      break;
    case INDENT_BULLET:
      break;
    case UNINDENT_BULLET:
      break;
  }
};

export default reducer;
